using Components;using System;using MessagePack;using HECSFramework.Serialize;using Commands;namespace HECSFramework.Core{	[MessagePackObject, Serializable]	public struct EntityHolderComponentResolver : IResolver<EntityHolderComponent>, IResolver<EntityHolderComponentResolver,EntityHolderComponent>, IData	{		public EntityHolderComponentResolver In(ref EntityHolderComponent entityholdercomponent)		{			return this;		}		public void Out(ref IEntity entity)		{			var local = entity.GetEntityHolderComponent();			Out(ref local);		}		public void Out(ref EntityHolderComponent entityholdercomponent)		{		}	}}